                Context.AuditColorGroups.Add(auditcolorgroup);
                Context.SaveChanges();
            }
            catch
            {
                Context.Entry(auditcolorgroup).State = EntityState.Detached;
                throw;
            }

            OnAfterAuditColorGroupCreated(auditcolorgroup);

            return auditcolorgroup;
